  false,\n\t\"url\": null,\n\t\"notes\": \"Data was submitted by Dr. Grald L. Engel.
  This study was organized toncollect data on Parasite Type and Location. Parasite
  (both ecto- andnendo-), and site of infection were looked into. SST, wave, turbidity,ngear
  type (trawl), species, parasite (both ecto- and endo-), and site ofninfection (i.e.
  data on parasite type and location) data were collected.nThe documentation describes
  instruments employed for sampling, units,nand a detailed description of the record
  format.nnThese studies were part of the Mid-Atlantic Outer Continental ShelfnStudies
  (OCS). These data were collected by the Virginia Institute ofnMarine Science (VIMS).
  Special codes employed by VIMS to describenparasite types and location were included
  as hardcopy. The originalninformation submitted on tape has been converted into
  the current NODCnstorage format.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
